let initialState = {
    user: [
        {
            user_id: 1,
            is_admin: false,
            apikey: ""
        }
    ],
    isOpenModal: false
};

function UserReducer(state = initialState, action) {
    if (handlers[action.type]){
        return handlers[action.type].handler(state, action);
    }
    return state;
}


const handlers  = {
    "to_do" : {
         handler(state, action){
            return {...state};
        }
    }
};

export default UserReducer;
